      <div className="modal">
        <div className="modal-content">
          {/* Agrega una clase para el estilo bohemio */}
          <span className="close" onClick={onClose}>&times;</span>
          <h2>Ocurri√≥ un error al guardar los datos</h2>
          <button className="ok-button" onClick={onClose}>OK</button>
        </div>
      </div>
    );
  };
  
  export default ModalCampoObligatorio;
